graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>MyMachine</b></font></td></tr><tr><td align="center"><font point-size="10">v @StrictMode</font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "problem" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>problem</b></td></tr><tr><td align="left" bgcolor="#FFF4CC"><font point-size="8"><b>⚠️ 1 issue</b><br/>Node cannot be reached from entry points<br/></font></td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00", penwidth=2, color="#FFA726"];
  "solution" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>solution</b></td></tr><tr><td align="left" bgcolor="#FFF4CC"><font point-size="8"><b>⚠️ 1 issue</b><br/>Node cannot be reached from entry points<br/></font></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "problem" -> "solution" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "one" -> "two" [labelOverlay="75%", labelhref="#srcLineTBD"];

  // Validation Warnings
  "warning_problem_0" [label=<⚠️ Node cannot be reached from entry<br/>points

Suggestion: Add an edge from an<br/>entry point or init node to this node>, shape=note, fillcolor="#FFF4CC", style=filled, fontsize=9];
  "warning_problem_0" -> "problem" [style=dashed, color="#999999", arrowhead=none];
  "warning_solution_0" [label=<⚠️ Node cannot be reached from entry<br/>points

Suggestion: Add an edge from an<br/>entry point or init node to this node>, shape=note, fillcolor="#FFF4CC", style=filled, fontsize=9];
  "warning_solution_0" -> "solution" [style=dashed, color="#999999", arrowhead=none];
}
